/**
 * Filters unit codes based on a search query
 * @param query The search query
 * @returns An array of matching unit codes
 */
export function filterUnitCodes(query: string): string[] {
  if (!query) return []

  const upperQuery = query.toUpperCase()

  // First try to find codes that start with the query
  const exactMatches = QUT_UNIT_CODES.filter((code) => code.startsWith(upperQuery))

  // If we have exact matches, return those (up to 5)
  if (exactMatches.length > 0) {
    return exactMatches.slice(0, 5) // Limit to 5 results
  }

  // Otherwise, try a more lenient search (contains)
  const containsMatches = QUT_UNIT_CODES.filter((code) => code.includes(upperQuery))

  return containsMatches.slice(0, 5) // Limit to 5 results
}
